import imgSelfie from '../../images/selfie.png';
import infoStyles from './info.module.css';
//import styles from '../../index.css';

function Info() {
  return (
    <section id='info' >
        <img src={imgSelfie} alt="Selfie"
            className={infoStyles.imgSelfie} ></img>
        <h1>Veronica Sanchez Justicia</h1>
        <h3>Full Stack Web Developer, Backend & Frontend | Systems Administrator</h3>
        <a href="#experience">
            View Experience
        </a>
    </section>
  );
}

export default Info;
